import React, { useState, useEffect } from "react";
import DetalleBusquedaProducto from "./DetalleBusquedaProducto";
import { useNavigate } from "react-router-dom";
import Swal from 'sweetalert2'
import EncabezadoProducto from "./EncabezadoProducto";

const BusquedaProducto = (props) => {
    const [Gestor, setGestor] = useState({
        Nombre_Producto: '',
        Categoria: ''
    })

    const navigate = useNavigate();

    const teclaPresionada = (e) => {
        const { name, value } = e.target
        setGestor({ ...Gestor, [name]: value })
    }

    const ClickBtnNuevo = () => {
        props.CambiarIdCategoria(0)
        navigate("/Producto/DetalleProducto")
    }

    const DetalleProducto = (Descripcion) => {
        props.CambiarIdProducto(Descripcion)
        navigate("/Producto/DetalleProducto")
    }

    const ClickBtnDelete = async (ID_TipoProducto) => {
        let URL = `http://localhost:${props.ApiPort}/api/ApiTipoProducto/EliminarTipoProducto?ID_TipoProducto=${ID_TipoProducto}`;
        try {
            let Result = await fetch(URL, {
                method: 'DELETE'
            }).then(async response => {
                if (!response.ok) {
                    console.log("No Ok - ClickBtnDelete")
                    throw new Error(response.statusText)
                }
                return await response.json()
            }).catch(error => {
                console.log(error)
            })
            if (Result.Codigo >= 0) {
                Swal.fire({
                    icon: "success",
                    title: "Categoria eliminada exitosamente",
                    showConfirmButton: false,
                    timer: 1500
                });
                ClickBtnBuscar()
            }
            else {
                Swal.fire({
                    icon: "error",
                    title: "Oops...",
                    text: Result.Mensaje
                });
                //console.log(Sucursales.Mensaje)
            }
        } catch (error) {
            Swal.fire({
                icon: "error",
                title: "Conexión Inválida",
                text: "No se pudo establecer la conexión con el servidor"
            });
        }
    }

    const ClickBtnBuscar = async () => {
        let URL = `http://localhost:${props.ApiPort}/api/ApiTipoProducto/ConsultaTipoPNombre?Categoria=${Gestor.Nombre_Categoria}`;
        try {
            let Categorias = await fetch(URL).then(async response => {
                if (!response.ok) {
                    console.log("No Ok - ClickBtnBuscar")
                    throw new Error(response.statusText)
                }
                return await response.json()
            }).catch(error => {
                console.log(error)
            })
            if (Categorias.Codigo >= 0) {
                setListaCategorias(Categorias.Contenido)
            }
            else {
                Swal.fire({
                    icon: "error",
                    title: "Oops...",
                    text: Categorias.Mensaje
                });
                //console.log(Sucursales.Mensaje)
            }
        } catch (error) {
            Swal.fire({
                icon: "error",
                title: "Conexión Inválida",
                text: "No se pudo establecer la conexión con el servidor"
            });
        }
    }

    const ClickBtnDescargar = async () => {
        let URL = `http://localhost:${props.ApiPort}/api/ApiSucursal/ReporteSucursales?Nombre_Sucursal=${Gestor.Nombre_Sucursal}&Descripcion=${Gestor.Descripcion}`;
        try {
            let Result = await fetch(URL).then(async response => {
                if (!response.ok) {
                    console.log("No Ok - ClickBtnDescargar")
                    throw new Error(response.statusText)
                }
                return await response.json()
            }).catch(error => {
                console.log(error)
            })
            if (Result.Codigo >= 0) {
                const templink = document.createElement('a')
                templink.href = `data:application/pdf;base64,${Result.Contenido}`
                templink.setAttribute('download', 'Reporte Sucursales.pdf')
                templink.click();
            }
            else {
                Swal.fire({
                    icon: "error",
                    title: "Oops...",
                    text: Result.Mensaje
                });
                //console.log(Sucursales.Mensaje)
            }
        } catch (error) {
            Swal.fire({
                icon: "error",
                title: "Conexión Inválida",
                text: "No se pudo establecer la conexión con el servidor"
            });
        }
    }

    const cargarProductos = async () => {
        let URL = `http://localhost:${props.ApiPort}/api/ApiTipoProducto/ConsultaTipoPNombre?Categoria=${Gestor.Nombre_Categoria}`
        try {
            let Categorias = await fetch(URL).then(async response => {
                if (!response.ok) {
                    console.log("No Ok")
                    throw new Error(response.statusText)
                }
                return await response.json()
            }).catch(error => {
                console.log(error)
            })
            if (Categorias.Codigo >= 0) {
                setListaCategorias(Categorias.Contenido)
            }
            else {
                Swal.fire({
                    icon: "error",
                    title: "Oops...",
                    text: Categorias.Mensaje
                });
                //console.log(Categorias.Mensaje)
            }
        } catch (error) {
            Swal.fire({
                icon: "error",
                title: "Conexión Inválida",
                text: "No se pudo establecer la conexión con el servidor"
            });
        }
    }

    const [ListaProductos, setListaProductos] = useState([])
    useEffect(() => {
        cargarProductos();
        //eslint-disable-next-line
    }, [])

    return <>
        <EncabezadoProducto ClickBtnNuevo={ClickBtnNuevo}
            ClickBtnBuscar={ClickBtnBuscar}
            ClickBtnDescargar={ClickBtnDescargar}
            teclaPresionada={teclaPresionada}
            Gestor={Gestor} />
        <DetalleBusquedaProducto ListaProductos={ListaProductos}
            DetalleProducto={DetalleProducto}
            ClickBtnDelete={ClickBtnDelete} />
    </>

}
export default BusquedaProducto;
